  beforeEach(async () => {
    await TestBed.configureTestingModule({
      imports: [EarlyProjectPageComponent]
    })
    .compileComponents();
    
    fixture = TestBed.createComponent(EarlyProjectPageComponent);
    component = fixture.componentInstance;
    fixture.detectChanges();
